import { Box, Flex, Heading, Text } from "@chakra-ui/layout";
import { Image } from "@chakra-ui/image";
import { Button } from "@chakra-ui/button";
import NavGoNFT from "../components/NavGoNFT";

import ArrowDown from "../images/Vector.png";
import GoFundImg from "../images/GoFundNft.png";

import '../CSS/GoNFT.css';

export default function GoFNT() {
    const evento = document.querySelector("#evento");

    evento?.addEventListener("mouseover",function(){

        const legenda = document.querySelector("#legenda");

        legenda?.classList.remove("hide");
    })
   
    evento?.addEventListener("mouseout",function(){

        const legenda = document.querySelector("#legenda");

        legenda?.classList.add("hide");
    })


    evento?.addEventListener("mouseover",function(){

        const Primeiralegenda = document.querySelector("#Primeiralegenda");

        Primeiralegenda?.classList.add("hidetxt");
    })
    
    evento?.addEventListener("mouseout",function(){

        const Primeiralegenda = document.querySelector("#Primeiralegenda");

        Primeiralegenda?.classList.remove("hidetxt");
    })

    evento?.addEventListener("mouseover",function(){

        const evento = document.querySelector("#evento");

        evento?.classList.add("botaoHover botaoHoverSumir");
    })
    
    evento?.addEventListener("mouseout",function(){

        const evento = document.querySelector("#evento");

        evento?.classList.remove("botaoHoverSumir");
    })



    return (
    <Box height="100%" backgroundColor="#FFFFFF" >
        <NavGoNFT />
         <Box position="relative" m="0 auto" maxW="1367px">
         <Flex ml="-20px" p="0 20px">
            <Box>
                <Image  src={GoFundImg}></Image>
            </Box>
            <Box mt="165px" ml="127px">
                <Text
                color="#A19D9D"
                fontSize="14px"
                fontWeight="bold"
                >APRESENTANDO...</Text>
                <Heading
                mt="-5px"
                className="gradient"
                fontFamily="Roboto"
                fontSize="48px"
                fontWeight="700"
                >
                GoFund NFT
                </Heading>
                
                <Text 
                className="hidetxt"
                id="Primeiralegenda"
                mt="25px" 
                fontSize="18px" 
                fontWeight="700"
                color="#454545">
                Gere receita e conquiste mais fãs<br/> 
                atraves da emissão de tokens
                </Text>
                <Text
                id="legenda"
                className="hide"
                mt="25px" 
                fontSize="18px" 
                fontWeight="700"
                color="#454545"
                >
                Você conquistando sua liberdade<br/>  
                diretamente com seus fãs. Emita <br/> 
                seus tokens, tenha receita e<br/> 
                
                
                </Text>

                <Button
                Id="evento"
                className="botaoHoverSumir"
                mt="18px"
                transition="all 500ms"
                boxShadow="0px 1px 4px rgba(0, 0, 0, 0.19)"
                borderRadius="45px"
                height="50px"
                width="250px"
                background="#fff"
                fontWeight="500"
                fontSize="16px" 
                _hover={{
                    transform: "translateY(5px)",
                }}
                >
                Quero emitir meu token
                </Button>

                <Button
                Id="evento"
                className="botaoHover"
                mt="10px"
                transition="all 500ms"
                boxShadow="0px 1px 4px rgba(0, 0, 0, 0.19)"
                borderRadius="45px"
                height="50px"
                width="250px"
                background="#fff"
                fontWeight="500"
                fontSize="16px" 
                _hover={{
                    transform: "translateY(5px)",
                }}
                >
                Quero ter minha liberdade<br/>
                junto com meus fãs
                </Button>

                <Text
                mt="40px"
                display="flex"
                alignItems="center"
                fontWeight="bold"
                fontSize="14px"
                className="gradient"
                >
                ROLE ABAIXO PARA SABER MAIS
                <Image ml="10px" src={ArrowDown}></Image>
                </Text>
            </Box>
        </Flex>
        </Box>
    </Box>
    );
}
